                <h1 className='brandName'>Samazon</h1>

                <div className='products'>
                    <div className='box'>
                        {newProducts}
                    </div>
                </div>
                <p onClick={addItem} className='trending'>Shop Trending Items Now</p>
            </div>
        </div>
    )
};

